import React from 'react'
import Input from '../../components/Input'
import Button from '../../components/Button'

const Form = ({
  isSignInPage = true
}) => {
  return (
    <div className='bg-white w-[800px] h-[800px] shadow-lg flex flex-col justify-center items-center rounded-xl'> 
    <div className='text-4xl font-bold'>Welcome {isSignInPage && "Back"}</div>
    <div className='text-xl font-light mb-14'> {isSignInPage ? 'Sign in to get started' : 'Sign up to get started'}</div>

  { !isSignInPage && <Input label='Full Name' name='name' placeholder='Enter your full name' className='mb-6'/> }


    <Input label='Email Address' name='email' placeholder='Enter your email id' className='mb-6'/>
    <Input label='Password' type='password' name='name' placeholder='Enter your password' className='mb-14'/>
    <Button label="Sign Up" className="w-1/2 mb-6" />
    <div> {isSignInPage ? "Don't have an account?" : 'Already have an account?'} <span className="text-primary cursor-pointer underline"> {isSignInPage} Sign In </span> </div>
    </div>
  )
}

export default Form
